import React, { Component } from 'react';
// import {NavLink} from "react-router-dom";
import $ from 'jquery';

class Myslider extends React.Component {
  constructor(props) {
    super(props)
  }

  divRef;

  componentDidMount() {
    // $(this.divRef).slider({
    $('.slider').slider({
      animation: "slide",
      controlNav: false,
      vertical: true,
      autoplaySpeed: 1000,
      speed: 300
    });
  }

  render() {

    return (

      <div>
        <div className='row_outer'>
          <h1> Aktualności</h1>

          <div className='col-12'>

            <div className='row news_wrapper align-items-center justify-content-center' />

            {/* Slider */}

            <div className="slider left">
              <h3>Take a leisurely jog in the park…together</h3>
              <h3>Try a spin class...together</h3>
              <h3>Take a bike ride around the city...together</h3>
              <h3>Go for an indoor tennis practice...together</h3>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default Myslider;
